  <|"ID" -> 1148565682600235008, "Text" -> "President Kagame concludes: We \
have a lot of work to do, we are not short of lessons showing us how to do \
it. We have more strength we should use to build the Rwandan family and make \
a contribution on the global scale, however small. But it starts at home. \
#PDLRwanda", "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 52.}, 
     "Instant", "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {257, 267}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565681237057536, "Text" -> "President Kagame: That is why \
Rwanda has to make extraordinary choices to heal from the tragedy and \
failures of our past. #PDLRwanda", "CreationDate" -> 
    DateObject[{2019, 7, 9, 8, 12, 52.}, "Instant", "Gregorian", -4.], 
   "Entities" -> <|"hashtags" -> {<|"text" -> "PDLRwanda", 
        "indices" -> {122, 132}|>}, "symbols" -> {}, "user_mentions" -> {}, 
     "urls" -> {}|>, "Language" -> "en", "FavoriteCount" -> 0, 
   "RetweetCount" -> 0|>, <|"ID" -> 1148565679857164289, 
   "Text" -> "President Kagame: I have still not understood how churches were \
turned into killing fields with those who taught the word of God choosing who \
should be killed. It is a failure that will continue to leave a mark on our \
history. #PDLRwanda", "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 52.}, 
     "Instant", "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {227, 237}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565678267539456, "Text" -> "President Kagame: You cannot call \
yourself a believer and behave as someone who is not a believer. #PDLRwanda", 
   "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 51.}, "Instant", 
     "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {99, 109}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565675297968129, "Text" -> "President Kagame: We should not \
just be repeating ourselves or wait to be taught what we already know and \
never use it towards achieving results. #PDLRwanda", 
   "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 50.}, "Instant", 
     "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {146, 156}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565673603489792, "Text" -> "President Kagame: We need aid \
today to use it so that we do not need it tomorrow. It is the same for \
teachings, you use them to address issues and move on to the next, you should \
not be taught to address the same issues over and over. #PDLRwanda", 
   "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 50.}, "Instant", 
     "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {235, 245}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565671745376256, "Text" -> "President Kagame: You should not \
be awaiting aid to help you to make the right choices. There is no assistance \
for that. It has to come from you. You can be taught but the ultimate choice \
is yours. #PDLRwanda", "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 50.}, 
     "Instant", "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {198, 208}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565669685997569, "Text" -> "President Kagame: Making the \
right choice is not expensive. It is something you have to demand of yourself \
before you take any action. You have to be able to stand behind your choice \
as one that moves you towards results #PDLRwanda", 
   "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 49.}, "Instant", 
     "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {221, 231}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565667676901378, "Text" -> "President Kagame: I really liked \
when Rick Warren said that dreaming is free. The same is true for making the \
right choice. We have to choose to practice purpose driven leadership and \
achieve results. #PDLRwanda", "CreationDate" -> 
    DateObject[{2019, 7, 9, 8, 12, 49.}, "Instant", "Gregorian", -4.], 
   "Entities" -> <|"hashtags" -> {<|"text" -> "PDLRwanda", 
        "indices" -> {201, 211}|>}, "symbols" -> {}, "user_mentions" -> {}, 
     "urls" -> {}|>, "Language" -> "en", "FavoriteCount" -> 0, 
   "RetweetCount" -> 0|>, <|"ID" -> 1148565665344905217, 
   "Text" -> "President Kagame: It means that all the good lessons we learn \
in church are left behind we leave church and we only apply them when we \
return to church. But we should be practicing these teachings in our every \
day life, in our homes, our work, our schools. #PDLRwanda", 
   "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 48.}, "Instant", 
     "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {257, 267}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565663369375744, "Text" -> "President Kagame: The only time \
Rwandans respect time is when they go to church. Even when it comes to \
cleanliness, people look their best when they go to church. I am not saying \
this is wrong, it is a good thing, but why don\[CloseCurlyQuote]t you apply \
it elsewhere. #PDLRwanda", "CreationDate" -> 
    DateObject[{2019, 7, 9, 8, 12, 48.}, "Instant", "Gregorian", -4.], 
   "Entities" -> <|"hashtags" -> {<|"text" -> "PDLRwanda", 
        "indices" -> {252, 262}|>}, "symbols" -> {}, "user_mentions" -> {}, 
     "urls" -> {}|>, "Language" -> "en", "FavoriteCount" -> 0, 
   "RetweetCount" -> 0|>, <|"ID" -> 1148565661217677313, 
   "Text" -> "President Kagame: If you wait for someone to point out your \
shortcomings,they will not be resolved because when you are criticized by \
others,you don\[CloseCurlyQuote]t believe them or you think it is \
disrespectful. It is human nature to reject criticism,that is why you need \
self evaluation", "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 47.}, 
     "Instant", "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565659590303745, "Text" -> "President Kagame: The first step \
is to be willing to correct yourself and to continuously learn. Find time for \
self examination, ask yourself why you are falling short, what your \
weaknesses are and find a way to address them. #PDLRwanda", 
   "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 47.}, "Instant", 
     "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {226, 236}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565657790926850, "Text" -> "President Kagame: It \
doesn\[CloseCurlyQuote]t mean that the teachings were not valuable, it means \
that we have fallen short of turning the teachings into action. That is the \
problem we have to address, learning is essential but it should not be in \
vain. #PDLRwanda", "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 46.}, 
     "Instant", "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {237, 247}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565656079654912, "Text" -> "President Kagame: Whether you are \
leaders in the public sector or other sectors, we need to examine why we \
always find we have fallen short of the objectives we have set. #PDLRwanda", 
   "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 46.}, "Instant", 
     "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {171, 181}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565654351618050, "Text" -> "President Kagame: I say this \
because all of us leaders gathered here know the teachings we receive at \
church,they make sense and we hear them everyday. But the goal is not to \
repeat good teachings, it is to move from teaching to action to achieve our \
purpose.", "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 45.}, "Instant", 
     "Gregorian", -4.], "Entities" -> <|"hashtags" -> {}, "symbols" -> {}, 
     "user_mentions" -> {}, "urls" -> {}|>, "Language" -> "en", 
   "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565652438994944, "Text" -> "President Kagame: Learning is \
essential but it must be followed by actions. If you do not apply what you \
learn, you will not achieve your goals. Teaching must have a purpose. I want \
us to find a way to match what we learn with our actions and our purpose.  \
#PDLRwanda", "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 45.}, 
     "Instant", "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {257, 267}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565650257981441, "Text" -> "President Kagame: Leadership \
means leaders with a purpose, who want those they serve to achieve their \
goals. #PDLRwanda", "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 44.}, 
     "Instant", "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "PDLRwanda", "indices" -> {109, 119}|>}, 
     "symbols" -> {}, "user_mentions" -> {}, "urls" -> {}|>, 
   "Language" -> "en", "FavoriteCount" -> 0, "RetweetCount" -> 0|>, 
  <|"ID" -> 1148565627763863554, "Text" -> "Dear Ladies and \
Gentlemen,\n\nDon\[CloseCurlyQuote]t miss your chance to serve with \
#YALIServes! \nIn just one week, young leaders across all of Africa will be \
joining together to honor the legacy of Nelson Mandela through local acts of \
volunteerism. Click the button below to join them! https://t.co/hLETlo0irG", 
   "CreationDate" -> DateObject[{2019, 7, 9, 8, 12, 39.}, "Instant", 
     "Gregorian", -4.], "Entities" -> 
    <|"hashtags" -> {<|"text" -> "YALIServes", "indices" -> {65, 76}|>}, 
